  createBrowserRouter,
  RouterProvider,
  Route,
  Link,
  Outlet,
} from "react-router-dom";
import Sidebar from "./Components/Sidebar";
import About from "./Pages/About";
import Home from "./Pages/Home";

const AppLayout = () => {
  <> 
    <Sidebar />
    <Outlet />
  </>
}

const router = createBrowserRouter([
  {
    element: <AppLayout />,
    children: [

    ]
  }

]);

